import { useParams } from "react-router-dom";
import axios from "axios";

function SelfiePage() {
  const { id } = useParams();
  axios
    .get(
      `https://333b478a-37cc-450f-80d0-23b422a28c01.mock.pstmn.io/products/${id}`
    )
    .then();
  return <h1>상품 상세 페이지 {id} </h1>;
}

export default SelfiePage;
